import './App.css';

function App() {
  return (
    <div className="App">
      <div className="content">
        <h1>F1 Driver Comparison</h1>
        <p>Data pulled from </p><a href="https://openf1.org">https://openf1.org</a>
      </div>
    </div>
  );
}

export default App;
